int outCnt;
void printOut(uint16_t v) {
    printf("0x%04x, ", v);
    outCnt++;
    if (outCnt >= 16) {
        outCnt = 0;
        printf("%s", "\n");
    }
}

void compress(char* name, const uint16_t *data, int size) {
    printf("const uint16_t %s [] = {\n", name);
    int outCnt=0;
    int repeatCnt=0;
    outCnt = 0;
    uint16_t lastColor = 0xfd00;
    for (int i=0; i<size; i++ ) {
        uint16_t c = data[i];
        if (c == lastColor) {
            repeatCnt++;
            if (repeatCnt == 0xff) {
                printOut(0xfd00 + repeatCnt );
                repeatCnt = 0;
            }
        } else {
            if (repeatCnt > 0) {
                printOut(0xfd00 + repeatCnt);
                repeatCnt = 0;
            }
            printOut(c);
        }
        lastColor = c;
    }
    if (repeatCnt > 0) {
        printOut(0xfd00 + repeatCnt);
        repeatCnt = 0;
    }
    printf("%s", "\n};\n");
}

